def main():
    button_element = partial(sg.Button, focus=True, visible=True, enable_events=True)
    input_text = partial(sg.InputText, size=(8, 4), justification='right')
    b64string = START_PHOTO
    # layout for start screen
    layout0 = [[sg.Column([
                           [sg.Image(data=b64string, key='author_image')],
                           [button_element('', key='next', size=(60, 5))]],
                          element_justification='center')]]

    # create the Window
    start_win = sg.Window(' -  , 5-14, 2023', layout0)
    _ = start_win.read()
    # need to destroy the window as it's still open
    start_win.close()

    # layout for main_prog
    col1 = [[sg.Text('tno')],
            [sg.Text('to')],
            [sg.Text('N')],
            [sg.Text('C1')],
            [sg.Text('C2')],
            [sg.Text('C3')],
            [sg.Text('S1')],
            [sg.Text('S')],
            [sg.Text('round')],
            ]

    col2 = [[input_text(default_text='1000', key='Tno')],
            [input_text(default_text='8', key='To')],
            [input_text(default_text='100', key='N')],
            [input_text(default_text='2', key='C1')],
            [input_text(default_text='3', key='C2')],
            [input_text(default_text='4', key='C3')],
            [input_text(default_text='350', key='S1')],
            [input_text(default_text='1000', key='S')],
            [input_text(default_text='3', key='round')]
            ]

    perems_name = ['C', u'P0', 'Q', 'L', 'U', u'0', 'n', u'e', 'W', 'Tp', 'T', '(e)/0', 'Y', 'round']
    data = [[p] + ['-'] * 3 for p in perems_name]
    headings = ['', '1', '2', '3']
    #
    fig, ax = plt.subplots(nrows=1, ncols=3, figsize=(20, 10), facecolor="#f0f0f0")
    ax[0].patch.set_facecolor('#f0f0f0')
    ax[1].patch.set_facecolor('#f0f0f0')
    ax[2].patch.set_facecolor('#f0f0f0')

    b = BytesIO()
    plt.savefig(b, format='PNG', dpi=50)
    b.seek(0)
    b64string = base64.b64encode(b.read())

    layout = [
        [
            sg.Column([
                [sg.Text(' ')],
                [sg.Column(col) for col in [col1, col2]], ], element_justification='left'),
            sg.Column([
                [sg.Table(values=data,
                          headings=headings,
                          max_col_width=50,
                          select_mode='extended',
                          auto_size_columns=False,
                          justification='right',
                          hide_vertical_scroll=True,
                          vertical_scroll_only=False,
                          num_rows=min(len(data), 20),
                          key='table',
                          background_color="#f0f0f0")
                 ],
            ]
            ),
            sg.Column([
                [
                    button_element('', key='calculate', size=(40, 3))
                ],
                [
                    button_element('', key='copy', size=(40, 3))
                ],
                [
                    button_element('', key='names', size=(40, 3))
                ],
                [
                    button_element('', key='save', size=(40, 3))
                ]
            ]),

        ],
        [
            [sg.Image(data=b64string, key='plot')]
        ]
    ]

    win = sg.Window('  .  -  , 5-14, 2023', layout)

    while True:
        events, values = win.read()
        if events is None:
            break
        if events == 'calculate':
            try:
                N = int(values['N'])
                To = int(values['To'])
                Tno = int(values['Tno'])
                S1 = int(values['S1'])
                S = int(values['S'])
                Cs = [int(values[k]) for k in ['C1', 'C2', 'C3']]
                around = int(values['round'])
                psi = To / Tno
                Y = []
                Tp = []
                res_L = []
                perems = [perems_name]
                for C in Cs:
                    pk = p0(N=N, psi=psi, C=C)
                    Q = q(pk, C=C, N=N)
                    res_L.append(L(pk, N=N))
                    U = u(res_L[-1], Q)
                    Rho0 = rho0(U, C=C)
                    Tp.append(tp(res_L[-1], N=N, tno=Tno))
                    W = w(Tp[-1], to=To)
                    Tc = tc(Tp[-1], tno=Tno)
                    Rhoe = rhoe(Tc, tno=Tno)
                    n = n_(N=N, l=res_L[-1])
                    Re2R0 = rhoe2rho0(Rhoe, Rho0)
                    Y.append(y(L=res_L[-1], S1=S1, S=S, C=C))
                    perems.append(
                        [C, round(pk[0], around), round(Q, around), round(res_L[-1], around), round(U, around),
                         round(Rho0, around),
                         round(n, around), round(Rhoe, around), round(W, around), round(Tp[-1], around), round(Tc, around),
                         round(Re2R0, around), round(Y[-1], around)])

                plt.cla()
                ax[0].patch.set_facecolor('#f0f0f0')
                ax[1].patch.set_facecolor('#f0f0f0')
                ax[2].patch.set_facecolor('#f0f0f0')

                ax[0].plot(Cs, Y, color='b')
                ax[0].grid(True)
                ax[0].set_xticks([_ for _ in range(0, max(Cs) + 1)])
                ax[0].set_title(' ')
                ax[0].set_xlabel('- , ', fontsize=15)
                ax[0].set_ylabel(', /', fontsize=15)
                ax[0].patch.set_facecolor('#f0f0f0')
                ax[0].set_ylim([min(Y) // 10 * 10 - 50, max(Y) // 10 * 10 + 50])
                ax[0].set_xlim([min(Cs) - 1, max(Cs) + 1])
                ax[0].minorticks_on()
                ax[0].xaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[0].yaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[0].yaxis.grid(which='minor', linestyle='-', linewidth='0.5', color='black', alpha=0.15)

                ax[1].plot(Cs, res_L, color='b')
                ax[1].grid(True)
                ax[1].set_xticks([_ for _ in range(0, max(Cs) + 1)])
                ax[1].set_title('    ')
                ax[1].set_xlabel('- , ', fontsize=15)
                ax[1].set_ylabel('.  ,    ', fontsize=15)
                ax[1].patch.set_facecolor('#f0f0f0')
                ax[1].set_xlim([min(Cs) - 1, max(Cs) + 1])
                ax[1].minorticks_on()
                ax[1].xaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[1].yaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[1].yaxis.grid(which='minor', linestyle='-', linewidth='0.5', color='black', alpha=0.15)

                ax[2].plot(Cs, Tp, color='b')
                ax[2].grid(True)
                ax[2].set_xticks([_ for _ in range(0, max(Cs) + 1)])
                ax[2].set_title(' .     ')
                ax[2].set_xlabel('- , ', fontsize=15)
                ax[2].set_ylabel('.      , c', fontsize=15)
                ax[2].patch.set_facecolor('#f0f0f0')
                ax[2].set_xlim([min(Cs) - 1, max(Cs) + 1])
                ax[2].minorticks_on()
                ax[2].xaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[2].yaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[2].yaxis.grid(which='minor', linestyle='-', linewidth='0.5', color='black', alpha=0.15)

                b = BytesIO()
                plt.savefig(b, format='PNG', dpi=50)
                b.seek(0)
                b64string = base64.b64encode(b.read())
                win['plot'].update(data=b64string)

                win['table'].update(values=[x for x in zip(*perems)])

            except Exception as e:
                print(e)
                layout = [
                    [sg.Text(' ', size=(20, 1))],
                    [sg.Cancel(size=(30, 3), button_text="")]
                ]
                window = sg.Window('', layout)
                save_event, save_values = window.Read()
                window.Close()

        if events == 'names':
            b64string = NAMES
            layout = [
                [sg.Column([
                    [sg.Image(data=b64string, key='author_image')],
                    [button_element('', key='next', size=(60, 5))]
                ], element_justification='center')
                ]
            ]
            window = sg.Window('', layout)
            save_event, save_values = window.Read()
            window.Close()

        if events == 'save':
            layout = [
                [sg.Text(' ', size=(15, 1)), sg.InputText()],
                [sg.Submit(size=(30, 3), button_text=""), sg.Cancel(size=(30, 3), button_text="")]
            ]
            window = sg.Window('', layout)
            save_event, save_values = window.Read()
            window.Close()

            if save_event == '':
                name_file = save_values[0]
                if '.' not in name_file[-5:]:
                    plt.savefig(name_file + '.png', format='PNG', dpi=150)
                else:
                    plt.savefig(name_file, dpi=150)
        if events == 'copy':
            pyperclip.copy('\n'.join(
                ['\t'.join([get_table_elem(x) for x in row])
                 for row in win['table'].get()]))

    win.close()


